import React from 'react';
import pc from './Post.module.css'

const Post = (props) => {
    return (
        <div className={pc.item}>
            <img className={pc.img} src='https://static.wallpapers-anime.com/upload/20170506/148/o/q/y/oqyDEF.png'/>
            {props.message}
            <div>
                {props.likecount}
                <span>
                    <img className={pc.item.img} src='https://icon2.kisspng.com/20180412/siq/kisspng-computer-icons-symbol-clip-art-heart-emoji-5acf29f2e550f4.0888987715235261309393.jpg'/>
                </span>

            </div>
        </div>

    );
}
export default Post;
